import { StatusBar } from "../node_modules/expo-status-bar";
import React, { useState } from "react";
import {   
    Text,
    View,
    Image,
    TextInput,
    TouchableOpacity } from "react-native";
    

    import registerStyles from '../style/UserRegisterStyle'
 
    export default function UserRegister({navigation}) {
      const [email, setEmail] = useState("");
      const [password, setPassword] = useState("");
      const [name, setName] = useState("");
      const [cpf, setCpf] = useState("");
      const [numero, setNumero] = useState("");
      const [telefone, setTelefone] = useState("");
      const [rua, setRua] = useState("");
      const [cep, setCep] = useState("");

    
      const goToIndexScreen = () => {
        navigation.reset({
            index: 0,
            routes: [{name: "Index"}]
        })
      }
     
      return (
        <View style={registerStyles.container}>

        <Text style={registerStyles.signInHeader}>Registre-se</Text>

          <StatusBar style="auto" />
          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="Nome"
              textAlign="center"
              placeholderTextColor="#003f5c"
              onChangeText={(name) => setName(name)}
            />
          </View>
     
          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="Cpf"
              placeholderTextColor="#003f5c"
              textAlign="center"
              onChangeText={(cpf) => setCpf(cpf)}
            />
          </View>

          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="Telefone / Celular"
              placeholderTextColor="#003f5c"
              textAlign="center"
              onChangeText={(telefone) => setTelefone(telefone)}
            />
          </View>

          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="Rua"
              placeholderTextColor="#003f5c"
              textAlign="center"
              onChangeText={(rua) => setRua(rua)}
            />
          </View>

          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="NÃºmero"
              placeholderTextColor="#003f5c"
              textAlign="center"
              onChangeText={(numero) => setNumero(numero)}
            />
          </View>

          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="Cep"
              placeholderTextColor="#003f5c"
              textAlign="center"
              onChangeText={(cep) => setCep(cep)}
            />
          </View>

          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="Email"
              placeholderTextColor="#003f5c"
              textAlign="center"
              onChangeText={(email) => setEmail(email)}
            />
          </View>

          <View style={registerStyles.inputView}>
            <TextInput
              style={registerStyles.TextInput}
              placeholder="Senha"
              placeholderTextColor="#003f5c"
              textAlign="center"
              secureTextEntry={true}
              onChangeText={(password) => setPassword(password)}
            />
          </View>

          <TouchableOpacity style={registerStyles.signUpBtn} onPress={() => goToIndexScreen()}>
            <Text style={registerStyles.loginText}>Concluir Registro</Text>
          </TouchableOpacity>
        </View>
      );
    }
